import React from 'react';
import './InfoModal.css'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';

const InfoModal = ({playerList}) => {
  return (
    <>
      <div className="mt-3">This tab isn't ready yet!</div>
      <FontAwesomeIcon className="mt-3" style={{fontSize: "1.5rem"}} icon="wrench"/>
    </>
  );
}

export default InfoModal;
